const levels = [
    {
      attempts: 7,
     image: <img src="/img/4.jpg" className="level-image" alt="Level 1" />
    },
    {
      attempts: 5,
      image: <img src={require('./img/3.jpg')} className="level-image" alt="Level 2" />
    },
    {
      attempts: 3,
      image: <img src={require('./img/5.jpg')} className="level-image" alt="Level 3" />
    }
  ];
  
  export default levels;
